import React from 'react'
import * as S from './NewsReel.styled'

const NewsReel = (props) => {
    const listArticles = () => {
        return props.articles.map(article => {
            return <S.Article>
                {article.title}
            </S.Article>
        })
    }

    return <S.NewsReel>
        {listArticles()}
    </S.NewsReel>
}

export default NewsReel
